-- ----------------------------
-- View structure for after_sales_service_table
-- ----------------------------
DROP VIEW IF EXISTS `after_sales_service_table`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `after_sales_service_table` AS (select `gser`.`id` AS `id`,`su`.`real_name` AS `real_name`,`gser`.`service_time` AS `service_time`,`gser`.`service_content` AS `service_content`,`gser`.`service_type` AS `service_type`,`gser`.`is_resolved` AS `is_resolved` from (`wms_goods_service` `gser` left join `sys_user` `su` on((`su`.`id` = `gser`.`service_operator_id`))) where (`gser`.`is_deleted` = 0)) ;

-- ----------------------------
-- View structure for goods_detail_info
-- ----------------------------
DROP VIEW IF EXISTS `goods_detail_info`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `goods_detail_info` AS (select `go`.`serial_number` AS `serial_number`,`go`.`quality_begin_date` AS `quality_begin_date`,`go`.`quality_expiry_date` AS `quality_expiry_date`,`go`.`promise_begin_date` AS `promise_begin_date`,`go`.`promise_expiry_date` AS `promise_expiry_date`,`gtype`.`type_name` AS `type_name`,`go`.`flow_status` AS `flow_status`,`go`.`specification` AS `specification`,`sup`.`supplier_name` AS `supplier_name`,`inre`.`instock_time` AS `instock_time`,`bitem`.`outstock_time` AS `outstock_time`,`gset`.`setup_time` AS `setup_time`,`su`.`real_name` AS `real_name`,`gset`.`setup_position` AS `setup_position`,`proj`.`project_name` AS `project_name`,`cust`.`customer_name` AS `customer_name`,`sub`.`real_name` AS `real_name_d`,`mar`.`is_marked` AS `is_marked`,`sumar`.`real_name` AS `real_name_mar`,`go`.`remark` AS `remark` from (((((((((((`wms_goods` `go` left join `wms_goods_type` `gtype` on((`gtype`.`id` = `go`.`type_id`))) left join `wms_supplier` `sup` on((`sup`.`id` = `go`.`supplier_id`))) left join `wms_instock_record` `inre` on((`inre`.`goods_id` = `go`.`id`))) left join `wms_outstore` `bitem` on((`bitem`.`goods_id` = `go`.`id`))) left join `wms_goods_setup` `gset` on((`gset`.`goods_id` = `go`.`id`))) left join `sys_user` `su` on((`su`.`id` = `gset`.`setup_operator_id`))) left join `wms_project` `proj` on((`proj`.`id` = `go`.`project_id`))) left join `wms_customer` `cust` on((`cust`.`id` = `proj`.`customer_id`))) left join `sys_user` `sub` on((`sub`.`id` = `bitem`.`delivery_operator_id`))) left join `wms_goods_marker` `mar` on((`mar`.`goods_id` = `go`.`id`))) left join `sys_user` `sumar` on((`sumar`.`id` = `mar`.`marked_operator_id`))) where (`go`.`is_deleted` = 0)) ;

-- ----------------------------
-- View structure for goods_list_for_outstore
