DROP VIEW IF EXISTS `goods_list_for_outstore`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `goods_list_for_outstore` AS (select `goods`.`id` AS `id3`,`goods`.`serial_number` AS `serial_number3`,`goods`.`type_id` AS `type_id3`,`gtype`.`type_name` AS `type_name3`,`goods`.`specification` AS `specification3`,`goods`.`supplier_id` AS `supplier_id3`,`supp`.`supplier_name` AS `supplier_name3`,`goods`.`quality_expiry_date` AS `quality_expiry_date3`,`inre`.`instock_time` AS `instock_time3`,`goods`.`project_id` AS `project_id3`,`pro`.`project_name` AS `project_name3` from ((((`wms_goods` `goods` left join `wms_goods_type` `gtype` on((`goods`.`type_id` = `gtype`.`id`))) left join `wms_supplier` `supp` on((`goods`.`supplier_id` = `supp`.`id`))) left join `wms_instock_record` `inre` on((`goods`.`id` = `inre`.`goods_id`))) left join `wms_project` `pro` on((`goods`.`project_id` = `pro`.`id`))) where ((`goods`.`is_deleted` = 0) and (`goods`.`flow_status` = '1'))) ;
